        name: "Samsum Galaxy",
        image: "",
        description: "San Pham cua SamSum",
        price: 250,
        inventory: 12
    },
    {
        id: 3,
        name: "Nokia 3030",
        image: "",
        description: "San Pham cua Nokia",
        price: 100,
        inventory: 8
    }
];

const product = (state= initialState, action) =>{
    switch(action.type){
        default: return [...state];
    }
}

export default product;
